import React, { useState } from 'react';
import { AppBar, Container, CssBaseline, Drawer, List, ListItem, ListItemIcon, ListItemText, Toolbar, Typography } from '@mui/material';
import { Menu as MenuIcon, Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  const [open, setOpen] = useState(false);

  const toggleDrawer = () => {
    setOpen(!open);
  };

  return (
    <div>
      <CssBaseline />
      <AppBar position="fixed">
        <Toolbar>
          <MenuIcon onClick={toggleDrawer} style={{ cursor: 'pointer' }} />
          <Typography variant="h6">My Web Page</Typography>
        </Toolbar>
      </AppBar>
      <Drawer anchor="left" open={open} onClose={toggleDrawer}>
        <List>
          <ListItem button>
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
            <ListItemText primary="Sidebar Item 1" />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <MailIcon />
            </ListItemIcon>
            <ListItemText primary="Sidebar Item 2" />
          </ListItem>
        </List>
      </Drawer>
      <div style={{ marginLeft: '240px' }}>
        <Container maxWidth="xl" style={{ backgroundColor: '#111115', minHeight: '100vh' }}>
          {/* Your content goes here */}
          <Typography variant="h4" style={{ color: '#ffffff' }}>
            Welcome to My Web Page
          </Typography>
        </Container>
      </div>
    </div>
  );
}

export default App;
